import React from "react";

interface Props {
  uuid: string;
  title: string;
  body: string;
  votes: number;
  username: string;
}

const CommunityPost: React.FC<Props> = ({
  uuid,
  title,
  body,
  username,
  votes,
}) => {
  return <div></div>;
};

export default CommunityPost;
